import React from "react";
import MathComfort from "../assets/mathcomfort.png";
const Page3 = () => {
  return (
    <div style={{ display: "flex", alignItems: "center" }}>
      <img
        src={MathComfort} // Replace "image_path.jpg" with the actual path to your image
        alt="Image Description"
        style={{ marginRight: "10px", width: "300px", height: "300px" }} // Adjust width and height as needed
      />
      <div>
        <p>
          Description goes here. Lorem ipsum dolor sit amet, consectetur adipiscing elit.
          Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam.
        </p>
      </div>
    </div>
  );
};

export default Page3;
